import { render } from "@testing-library/react";
import React, { Fragment } from "react";
import Title from "./title";
import Card from "./card";
import "./home.css";
class Home extends React.Component {
  render() {
    return (
      <Fragment>
        <Title title="Lautaro Nasello" subtitle="Frontend Developer Web" />
        <div className="card-group text-center">
          <Card section="About" text="Something about my personal life" />
          <Card section="Knowledge" text="My knowledge from new tecnologies" />
          <Card
            section="Experience"
            text="My experience and learnig achademys"
          />
          <Card section="Projects" text="Personal projects running for test" />
          <Card section="Contact" text="Social Media to contact and chat me!" />
        </div>
      </Fragment>
    );
  }
}

export default Home;
